import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }


    render() {
      return (
        <div className="filterContainer">
          <div className="roomFilter">
            <input id="roomNumber" placeholder="Enter Room Number">
            </input>
          </div>
          <div className="floorFilter" placeholder="Enter Floor Number">
            <input id="floorNumber">
            </input>
          </div>
          <div className="seatFilter" placeholder="Min Number of ">
            <input id="seatNumber">
            </input>
          </div>
          <div className="projectorFilter">
            <input id="projector">
            </input>
          </div>
          <div className="computersFilter">
            <input id="computers">
            </input>
          </div>
        </div>
      );
    }
  }
  
  export default App;
